package tests.generator.memberAccess

fun f(param: Any?)

fun g() -> result: Boolean

fun h() -> (result1: Boolean, result2: Boolean)

class C() {
    attr a: Int
    @PythonName("c") attr b: Int

    @PythonCall("$param.i($this)") fun i(param: Any?)
}

fun factory() -> instance: C?

pipeline test {
    f(g().result);
    f(h().result1);
    f(h().result2);
    f(C().a);
    f(C().b);
    f(factory()?.a);
    f(factory()?.b);
    f(C().i(1));
}
